import React from "react";
import GridItem from "./GridItem";

import "./GridList.css"

const GridList = () => {
  return(
    <ul class="gridList">
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
      <GridItem />
    </ul>
  );
}

export default GridList;
